    cli=()=>{
        axios.get('https://pokeapi.co/api/v2/pokemon/tentacool')
        .then(res=>{
            console.log(res);
        })
    }
    render(){
        return(
            <div  className='container'>
                <div className='row'>
                <div  className='col-md-4 offset-md-2 '>
                <h2>terferehr</h2>
                </div>
                <div className='col-md-4 '>
                <button onClick={this.cli}>faegsrhe</button>
                <Pokocard/>
                </div>
                </div>
                
            </div>
        )
    }
}
export default App;
